// whyData.js
import qualityImg from '../images/quality.svg';
import reliabilityImg from '../images/reliability.svg';
import supportImg from '../images/support.svg';
import experienceImg from '../images/experience.svg';

const whyReasons = [
    {
        id: 1,
        title: "Качество и цена 24/7",
        text: "Будьте уверены, у нас самые лучшие цена на самые качественные услуги",
        image: qualityImg,
        alt: "Качество и цена"
    },
    {
        id: 2,
        title: "Надёжность",
        text: "Полная автоматизация запуска и выполнения всех услуг на максимально безопасной скорости",
        image: reliabilityImg,
        alt: "Надёжность"
    },
    {
        id: 3,
        title: "Техподдержка 24/7",
        text: "Нужна помощь? Постараемся быстро помочь в тикетах или чате практически в любое время суток",
        image: supportImg,
        alt: "Техподдержка"
    },
    {
        id: 4,
        title: "Опыт работы",
        text: "Мы качаем соц. сети уже более 7 лет и выполнили более 13 миллионов заказов",
        image: experienceImg,
        alt: "Опыт работы"
    }
];

export default whyReasons;
